import { connect } from 'react-redux';
import Searchbar from '../SearchBar/searchbar';
import Nav from '../Nav/nav';
import { getAllGames, getGenres } from '../../redux/Actions/actions';

import Videogames from '../Videogames/videogames';

function Homepage({ getAllGames, getGenres }) {
  // Llamar a la acción cuando el componente se monta
  useEffect(() => {
    // Llamamos a las acciones necesarias al montar el componente
    getAllGames();
    getGenres();
  }, [getAllGames, getGenres]);

  return (
    <div>
      <h2>hola</h2>
      <Searchbar />
      <Nav />
      <Videogames></Videogames>
    </div>
  );
}

const mapStateToProps = (state) => ({
  // Puedes mapear el estado necesario aquí si lo necesitas
});

export default connect(mapStateToProps, { getAllGames, getGenres })(Homepage);
